import React from 'react';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Input from '@material-ui/core/Input';
import Paper from '@material-ui/core/Paper';
import withStyles from '@material-ui/core/styles/withStyles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import styles from './style'
class LoginComponent extends React.Component{
    render(){
        const {classes} =this.props
return (
    <main className={classes.main}>
        <CssBaseline></CssBaseline>
        <Paper className={classes.paper}>
            <Typography component="h1" variant='h5'>Log In!</Typography>
            <form className={classes.form} onSubmit={(e) => this.submitLogin(e)}>
                <FormControl required fullWidth margin='nomal'>
                    <InputLabel htmlFor='login-email-input'>
                        Enter Your Email!
                    </InputLabel>
                    <Input autoComplete='email' autoFocus id="login-email-input" onChange={(e) =>this.userTyping('email',e)}></Input>
                </FormControl>
                <FormControl required fullWidth margin='nomal'>
                    <InputLabel htmlFor='login-password-input'>
                        Enter Your Password
                    </InputLabel>
                    <Input type='password' autoComplete='email' autoFocus id="login-password-input" onChange={(e) =>this.userTyping('password',e)}></Input>
                </FormControl>
            </form>
        </Paper>
    </main>
)
}
    userTyping = (type,e) =>{
        console.log(type,e)
    }
}

export default withStyles(styles)(LoginComponent)
